Picked this up years ago @futuremusicstore and it has been an essential piece in my studio. It does so damn much. What I love about this era of analog synthesizers is that it’s all about the musician.  There are no preset sounds here…you are the scientist and you must discover the sound. It’s all class A components and super fat sounding. If you are in the market for a great analog synth…trust me…I’d rather have one great analog synth over 10 mediocre modern synths. But I’m different…but if you are into the music I love, you gotta get a quality analog synth.

