No dia 24 de setembro de 2023, Jazz Is Dead celebra os inúmeros pioneiros da cultura com discussões ao vivo, #discotecagens, #arte e muito mais. Convidados especiais nos ajudarão a compreender as conexões transnacionais entre #samba, #jazz, #funk e #hiphop. A #músicabrasileira é uma alquimia de expressão cultural, criando uma das mais ricas fontes musicais do mundo.  Com as suas raízes #africanas, serve como um caldeirão de espírito e ritmo, influenciando todas as formas de música em todo o mundo.

“Summit” é o ponto mais alto de uma montanha… o ápice. Para o nosso primeiro evento em São Paulo, sentimos que não bastava simplesmente fazer um show ou uma noite de festa. Queríamos atingir o ponto mais alto da inspiração musical. Então chamamos nossos amigos e colaboradores, os maestros e seus pares contemporâneos e uma dezena de nossos #DJs favoritos para criar o Jazz Is Dead Summit: São Paulo.

